import './App.css';
import {
  BrowserRouter,
  Routes,
  Route
} from "react-router-dom";
import Upload from './Upload';


function App() {

  return (  

    <BrowserRouter>
    <Routes>
      <Route path="upload" element={<Upload />} />
    </Routes>
  </BrowserRouter>);
}

export default App;
